Product_Performance_Trend.query:
q = load "${App.Datasets.Demo_Account_Metrics.FullyQualifiedName}";
q = group q by ('Date_Year{{cell(date_parser_1.result, 0, "Is_Fiscal").asString()}}', 'Date_Month{{cell(date_parser_1.result, 0, "Is_Fiscal").asString()}}');
q = foreach q generate 'Date_Year{{cell(date_parser_1.result, 0, "Is_Fiscal").asString()}}' + "~~~" + 'Date_Month{{cell(date_parser_1.result, 0, "Is_Fiscal").asString()}}' as 'Date_Year{{cell(date_parser_1.result, 0, "Is_Fiscal").asString()}}~~~Date_Month{{cell(date_parser_1.result, 0, "Is_Fiscal").asString()}}', sum('Quantity') as 'Quantity', sum('Revenue') as 'Revenue';
